import React, { Component } from 'react';
import Balance from '../Balance/balance';
import AddFunds from '../AddFunds/addFunds';


class Funds extends Component {

    constructor(){
        super()

        console.log("Hello")

    }

    render() {
      return (
        <div className="stock">
            <h2>Funds</h2>
            <Balance value = {this.props.balance}/>
            <AddFunds />
        </div>
      );
    }
  }

  export default Funds;
